import React, {useState, useEffect} from 'react';
import axios from "axios";
const apiKey = "1006fef0a3b86d3192ae766835bf6dc3"


function App() {
let queryUrl = "http://api.openweathermap.org/data?"
  useEffect(()=> {
    axios.get(queryUrl,{
      params: {
        key: apiKey,
        part: "",
        q: "london",
        maxResults: 2
      }
    }).then(data => console.log(data))
  },[])
  return (
    <div className="App">
      <header className="App-header">

      </header>
    </div>
  );
}

export default App;
